import React from 'react';

const Footer = ()=>{
    return(
        <>
            <div className='container-fluid footer'>
                <div className='container'>
                    <div className='row'>
                        <div className='col-lg-4 col-md-4 col-sm-6 col-12'></div>
                        <div className='col-lg-4 col-md-4 col-sm-6 col-12'></div>
                        <div className='col-lg-4 col-md-4 col-sm-6 col-12'></div>
                    </div>
                </div>
            </div>

        </>
    );
};
export default Footer;
